T.h(t," Uma vez tratada a doen\xe7a, os pacientes devem retornar ao consult\xf3rio. S\xe3o visitas para manuten\xe7\xe3o que objetivam assegurar a estabilidade da condi\xe7\xe3o de sa\xfade alcan\xe7ada com o tratamento e, assim, evitar tanto a progress\xe3o da doen\xe7a como a sua recidiva. Nos casos mais avan\xe7ados, recomenda-se uma periodicidade de tr\xeas / tr\xeas meses e de quatro a seis meses para a maioria das pessoas. Uma das d\xfavidas mais freq\xfcentes dos pacientes \xe9 se uma vez tratada a doen\xe7a, os tecidos periodontais recuperam-se integralmente.Bem,com exce\xe7\xe3o das gengivites, as doen\xe7as periodontais deixam altera\xe7\xf5es est\xe9ticas como: deslocamentos na posi\xe7\xe3o dos dentes, retra\xe7\xe3o gengival com conseq\xfcente aumento no comprimento dos dentes. Existem procedimentos cir\xfargicos e prot\xe9ticos que podem minimizar esses defeitos. ")
s.q(T.y(p,t,r))
T.h(t," As doen\xe7as periodontais s\xe3o grandes respons\xe1veis pela perda de dentes em adultos, mas sua preven\xe7\xe3o pode ser feita unicamente removendo a placa bacteriana atrav\xe9s da limpeza bucal com fio dental e escova, mais limpezas peri\xf3dicas feitas pelo dentista. Quando houver sangramento na gengiva, n\xe3o se deve parar de usar o fio dental e nem a escova\xe7\xe3o, deve-se faz\xea-los de forma correta sem machucar a gengiva (que j\xe1 est\xe1 inflamada), dessa forma melhorando o quadro de inflama\xe7\xe3o s\xf3 com a higiene.Por\xe9m, isso n\xe3o descarta a necessidade de procurar um cirurgi\xe3o-dentista. Pesquisas anteriores haviam mostrado que a doen\xe7a periodontal est\xe1 ligada a piora da doen\xe7a cardiovascular e eleva\xe7\xe3o dos marcadores biol\xf3gicos de inflama\xe7\xe3o. A integridade da sa\xfade periodontal al\xe9m de evitar perdas dent\xe1rias, previne a manifesta\xe7\xe3o e agravamento de algumas condi\xe7\xf5es sit\xeamicas. ")
